import React from 'react';
import { Sidenav, Nav } from 'rsuite';
import { useNavigate } from 'react-router-dom';
import DashboardIcon from '@rsuite/icons/legacy/Dashboard';
import GroupIcon from '@rsuite/icons/legacy/Group';
import MagicIcon from '@rsuite/icons/legacy/Magic';
import GearCircleIcon from '@rsuite/icons/legacy/GearCircle';

const SideBar = () => {
  const navigate = useNavigate();

  const handleSelect = (eventKey) => {
    navigate(`/${eventKey}`);
  };

  return (
    <div style={{ width: 240 }}>
      <Sidenav defaultOpenKeys={['3', '4']} activeKey="1">
        <Sidenav.Body>
          <Nav onSelect={handleSelect}>
            <Nav.Item eventKey="dashboard" icon={<DashboardIcon />}>
              Dashboard
            </Nav.Item>
            <Nav.Item eventKey="user-group" icon={<GroupIcon />}>
              User Group
            </Nav.Item>
            <Nav.Menu eventKey="advanced" title="Advanced" icon={<MagicIcon />}>
              <Nav.Item eventKey="geo">Geo</Nav.Item>
              <Nav.Item eventKey="devices">Devices</Nav.Item>
              <Nav.Item eventKey="loyalty">Loyalty</Nav.Item>
              <Nav.Item eventKey="visit-depth">Visit Depth</Nav.Item>
            </Nav.Menu>
            <Nav.Menu eventKey="settings" title="Settings" icon={<GearCircleIcon />}>
              <Nav.Item eventKey="applications">Applications</Nav.Item>
              <Nav.Item eventKey="channels">Channels</Nav.Item>
              <Nav.Item eventKey="versions">Versions</Nav.Item>
              <Nav.Menu eventKey="custom-action" title="Custom Action">
                <Nav.Item eventKey="action-name">Action Name</Nav.Item>
                <Nav.Item eventKey="action-params">Action Params</Nav.Item>
              </Nav.Menu>
            </Nav.Menu>
          </Nav>
        </Sidenav.Body>
      </Sidenav>
    </div>
  );
};

export default SideBar;
